impl Solution {
    pub fn maximum_sum_queries(mut nums1: Vec<i32>, mut nums2: Vec<i32>, queries: Vec<Vec<i32>>) -> Vec<i32> {
        let mut sums: Vec<(i32, i32)> = nums1.into_iter().zip(nums2.into_iter()).collect();
        sums.sort_unstable_by_key(|k| (k.0, k.1));
        let mut prefix_max = Vec::new();
        let mut current_max = std::i32::MIN;
        for (x, y) in sums.iter() {
            current_max = current_max.max(x + y);
            prefix_max.push(current_max);
        }
        queries.iter().map(|query| {
            let (xi, yi) = (query[0], query[1]);
            let pos = sums.binary_search_by(|k| {
                if k.0 >= xi && k.1 >= yi { std::cmp::Ordering::Greater }
                else { std::cmp::Ordering::Less }
            }).unwrap_or_else(|e| e);
            if pos == sums.len() || sums[pos].0 < xi || sums[pos].1 < yi {
                -1
            } else {
                *prefix_max.get(pos).unwrap_or(&-1)
            }
        }).collect()
    }
}
